select distinct 'select f_inserir_fechamento_reabertura_bimestre (f_inserir_fechamento_reabertura(''Ano ' || tc.ano_letivo ||''', ' ||
									    		 										          '''2020-12-07'', ''2020-12-22'', ' ||
									    		 										          tc.id || ', ' || ue.dre_id || ', ' ||
									    		 										          ue.id || ', null, 1, false, ''sistema'', ''sistema''), ' ||
									    		 	 	          pe.bimestre || ', ''sistema'', ''sistema'');'
	from aula a 
		inner join tipo_calendario tc
			on a.tipo_calendario_id = tc.id
		inner join periodo_escolar pe
			on tc.id = pe.tipo_calendario_id 
		inner join turma t
			on a.turma_id = t.turma_id
		inner join ue
			on t.ue_id = ue.id		
where tc.ano_letivo = 2018 and
	  t.ano_letivo = 2018 and	  
	  tc.id in (7, 8, 9) and
	  ue.tipo_escola in (1, 3, 4, 16) and
	  not a.excluido and
	  not tc.excluido;
	  
